import React from 'react';

import MoviesList from './components/MoviesList';
import './App.css';

function App() {
 function fetchMovieHandler(){
   fetch((response)=>{
return response.json();
   }).then((data)=>{
     console.log(data)
   })
 }


  return (
    <React.Fragment>
      <section>
        <button>Fetch Movies</button>
      </section>
      <section>
        <MoviesList movies={fetchMovieHandler} />
      </section>
    </React.Fragment>
  );
}

export default App;
